import React from 'react';
import logo from './logo.svg';
import './App.css';
import Container from 'react-bootstrap/Container';
import {Row, Col} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import Intro from './components/Intro';


var rowStyle= {
  backgroundColor:'red',
  height:'100vh',
  marginBottom: 5
}

function App() {
  return (
    <div className="App">
      <Container fluid>
        <Row style={rowStyle}><Intro></Intro></Row>
        <Row style={rowStyle}>
          <Col>Lyric</Col>
          <Col>Cover</Col>
          <Col>Text</Col>
        </Row>
      </Container>


    </div>
  );
}

export default App;
